//adno.app/ permet à l’Utilisateur un accès gratuit aux services suivants : la visualisation d’images, l’annotation d’images, la représentation des annotations sous des formes diverses, la diffusion et le partage des annotations sous des formes diverses, des exemples d’utilisation, une documentation. Le site est accessible gratuitement en tout lieu à tout Utilisateur ayant un accès à Internet. Tous les frais supportés par l’Utilisateur pour accéder au service (matériel informatique, logiciels, connexion Internet, etc.) sont à sa charge. Art. 2 : Collecte des données Le site ne requiert aucune ouverture de compte par les Utilisateurs et il ne collecte aucune donnée concernant les Utilisateurs. Un formulaire de contact nous permet de recevoir, gérer et répondre aux questions relatives aux objectifs et aux fonctionnement du site. Ce formulaire collecte les données personnelles suivantes : nom, courriel. Le renseignement de ce formulaire est libre et basé sur le consentement. Le responsable de ce traitement est l’Espace Mendès France, Poitiers. Conformément à la Loi Informatique et Libertés et le Règlement général sur la protection des données (RGPD), vous disposez d’un droit d’accès, de modification, de suppression et d’opposition au traitement de vos données à caractère personnel. Pour faire valoir ce droit ou pour tout autre demande relative à la gestion des données personnelles, adressez un message à contact[@]emf.fr ou via le formulaire du site. Le service de contact est opéré par le service Un-static dont le siège social est situé Prinses Margrietplantsoen 33, 2595 AM, The Hague (Pays-Bas). Art. 3 : Propriété intellectuelle Les marques, logos, signes ainsi que tous les contenus du site (textes, images, son, etc.) font l’objet d’une protection par le Code de la propriété intellectuelle et plus particulièrement par le droit d’auteur. La marque https://adno.app/ est une marque déposée par Espace Mendès France (Poitiers). Toute représentation et/ou reproduction et/ou 